import React, { useState, useEffect } from 'react';
import './Orders.css';

const Orders = () => {
  const [activeTab, setActiveTab] = useState('active');
  const [orders, setOrders] = useState([]);
  const [predictions, setPredictions] = useState([]);

  const sampleOrders = [
    {
      orderId: 'ORD-2024-001',
      medicine: 'NOW Foods, Vitamin D-3',
      quantity: 500,
      orderDate: '2024-02-15',
      expectedDelivery: '2024-03-01',
      status: 'In Transit',
      supplier: 'NOW Foods Inc.',
      amount: 2500,
      tracking: {
        current: 'In Transit',
        location: 'Distribution Center',
        updates: [
          { date: '2024-02-15', status: 'Order Placed' },
          { date: '2024-02-16', status: 'Processing' },
          { date: '2024-02-18', status: 'Shipped' },
          { date: '2024-02-20', status: 'In Transit' }
        ]
      }
    },
    {
      orderId: 'ORD-2024-002',
      medicine: 'Amoxicillin 500mg',
      quantity: 1000,
      orderDate: '2024-02-18',
      expectedDelivery: '2024-03-05',
      status: 'Processing',
      supplier: 'PharmaCo Ltd',
      amount: 3500,
      tracking: {
        current: 'Processing',
        location: 'Supplier Warehouse',
        updates: [
          { date: '2024-02-18', status: 'Order Placed' },
          { date: '2024-02-19', status: 'Processing' }
        ]
      }
    }
  ];

  const samplePredictions = [
    {
      category: 'Seasonal Trends',
      predictions: [
        {
          medicine: 'Flu Vaccines',
          predictedDemand: 500,
          confidence: 85,
          reason: 'Approaching winter season',
          historicalData: {
            lastYear: 450,
            trend: 'Increasing',
            peakMonths: ['December', 'January']
          },
          environmentalFactors: {
            temperature: 'Dropping',
            humidity: 'High',
            seasonalPattern: 'Pre-winter'
          }
        },
        {
          medicine: 'Allergy Medications',
          predictedDemand: 300,
          confidence: 78,
          reason: 'Spring season approaching',
          historicalData: {
            lastYear: 280,
            trend: 'Stable',
            peakMonths: ['March', 'April']
          },
          environmentalFactors: {
            temperature: 'Moderate',
            pollenCount: 'Rising',
            seasonalPattern: 'Early Spring'
          }
        }
      ]
    },
    {
      category: 'Disease Outbreaks',
      predictions: [
        {
          medicine: 'Antibiotics',
          predictedDemand: 750,
          confidence: 92,
          reason: 'Increased respiratory infections',
          impactZones: ['Urban areas', 'Schools'],
          recommendedAction: 'Increase stock by 25%'
        }
      ]
    },
    {
      category: 'Local Health Trends',
      predictions: [
        {
          medicine: 'Diabetes Medications',
          predictedDemand: 400,
          confidence: 88,
          reason: 'Rising diabetes cases in local area',
          demographicFactors: {
            ageGroup: '40-60',
            lifestyle: 'Sedentary',
            dietaryPatterns: 'High sugar intake'
          }
        }
      ]
    }
  ];

  useEffect(() => {
    setOrders(sampleOrders);
    setPredictions(samplePredictions);
  }, []);

  const renderActiveOrders = () => (
    <div className="orders-table">
      <table>
        <thead>
          <tr>
            <th>Order ID</th>
            <th>Medicine</th>
            <th>Quantity</th>
            <th>Order Date</th>
            <th>Expected Delivery</th>
            <th>Status</th>
            <th>Actions</th>
          </tr>
        </thead>
        <tbody>
          {orders.map(order => (
            <tr key={order.orderId}>
              <td>{order.orderId}</td>
              <td>{order.medicine}</td>
              <td>{order.quantity}</td>
              <td>{order.orderDate}</td>
              <td>{order.expectedDelivery}</td>
              <td>
                <span className={`status-badge ${order.status.toLowerCase().replace(' ', '-')}`}>
                  {order.status}
                </span>
              </td>
              <td>
                <button className="track-btn">Track Order</button>
              </td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );

  const renderPredictions = () => (
    <div className="predictions-container">
      {predictions.map((category, index) => (
        <div key={index} className="prediction-category">
          <h3>{category.category}</h3>
          <div className="prediction-cards">
            {category.predictions.map((prediction, pIndex) => (
              <div key={pIndex} className="prediction-card">
                <h4>{prediction.medicine}</h4>
                <div className="prediction-details">
                  <div className="confidence-meter">
                    <div 
                      className="confidence-bar"
                      style={{ width: `${prediction.confidence}%` }}
                    ></div>
                    <span>{prediction.confidence}% Confidence</span>
                  </div>
                  <p><strong>Predicted Demand:</strong> {prediction.predictedDemand} units</p>
                  <p><strong>Reason:</strong> {prediction.reason}</p>
                  {prediction.environmentalFactors && (
                    <div className="environmental-factors">
                      <h5>Environmental Factors</h5>
                      <ul>
                        {Object.entries(prediction.environmentalFactors).map(([key, value]) => (
                          <li key={key}>{key}: {value}</li>
                        ))}
                      </ul>
                    </div>
                  )}
                </div>
              </div>
            ))}
          </div>
        </div>
      ))}
    </div>
  );

  return (
    <div className="orders-container">
      <div className="orders-tabs">
        <button 
          className={`tab ${activeTab === 'active' ? 'active' : ''}`}
          onClick={() => setActiveTab('active')}
        >
          Active Orders
        </button>
        <button 
          className={`tab ${activeTab === 'history' ? 'active' : ''}`}
          onClick={() => setActiveTab('history')}
        >
          Order History
        </button>
        <button 
          className={`tab ${activeTab === 'predictions' ? 'active' : ''}`}
          onClick={() => setActiveTab('predictions')}
        >
          AI Predictions
        </button>
      </div>

      <div className="tab-content">
        {activeTab === 'active' && renderActiveOrders()}
        {activeTab === 'predictions' && renderPredictions()}
        {activeTab === 'history' && <div>Order History Content</div>}
      </div>
    </div>
  );
};

export default Orders;
